import './components/communityPage.css'; // Assuming you have a separate CSS file for CommunityPage styles

function CommunityPage() {
  const [menuOpen, setMenuOpen] = useState(false);

  const toggleMenu = () => {
    setMenuOpen(!menuOpen);
  };

  return (
    <div className="community-page">
      <div className="menu">
        <button className="menu-button" onClick={toggleMenu}>Menu</button>
        {menuOpen && (
          <div className="menu-content">
            {/* Add your menu items here */}
            <p>Menu Item 1</p>
            <p>Menu Item 2</p>
            <p>Menu Item 3</p>
          </div>
        )}
      </div>
      <div className="search-bar">
        <input type="text" placeholder="Search..." />
        <button>Search</button>
      </div>
      <div className="content">
        <h2>Community Page</h2>
        <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed euismod felis eget sapien scelerisque, id scelerisque justo vestibulum.</p>
