        <img src="https://www.the-rampage.org/wp-content/uploads/2019/05/263480.jpg" alt="Community" style={{ maxHeight: '400px', width: 'auto' }} />
        {/* Add more Lorem Ipsum content here */}
      </div>
    </div>
  );
}

export default CommunityPage;
